    t[316] = "Floodfill participation helps the network, but may use more of your computer's resources.";
    t[317] = "\u0423\u0447\u0430\u0441\u0442\u0438\u0435 \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 Floodill-\u0443\u0437\u043b\u0430 \u043f\u043e\u043c\u043e\u0433\u0430\u0435\u0442 \u0441\u0435\u0442\u0438, \u043d\u043e \u043c\u043e\u0436\u0435\u0442 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0431\u043e\u043b\u044c\u0448\u0435 \u0440\u0435\u0441\u0443\u0440\u0441\u043e\u0432 \u0432\u0430\u0448\u0435\u0433\u043e \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u0430.";
    t[318] = "Show all routers with this encryption type in the NetDb";
    t[319] = "\u041f\u043e\u043a\u0430\u0437\u0430\u0442\u044c \u0432\u0441\u0435 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u044b \u0441 \u044d\u0442\u0438\u043c \u0442\u0438\u043f\u043e\u043c \u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u044f \u0432 NetDb";
    t[326] = "News from the Taiwan Capital";
    t[327] = "\u041d\u043e\u0432\u043e\u0441\u0442\u0438 \u0438\u0437 \u0441\u0442\u043e\u043b\u0438\u0446\u044b \u0422\u0430\u0439\u0432\u0430\u043d\u044f";
