    t[331] = "\u0417\u0430\u0434\u0435\u0440\u0436\u043a\u0430 \u0437\u0430\u0434\u0430\u0447";
    t[334] = "Capabilities";
    t[335] = "\u0425\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0441\u0442\u0438\u043a\u0438";
    t[342] = "SOCKS 5";
    t[343] = "SOCKS 5";
