    t[851] = "\u041f\u043e\u043b\u0443\u0447\u0430\u0439\u0442\u0435 \u043d\u043e\u0432\u043e\u0441\u0442\u0438 \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e HTTP-\u043f\u0440\u043e\u043a\u0441\u0438 I2P";
