    t[1661] = "\u041a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044f \u0437\u043e\u043d\u0434\u0438\u0440\u0443\u044e\u0449\u0438\u0445 \u0442\u0443\u043d\u043d\u0435\u043b\u0435\u0439 \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0430.";
