    t[2500] = "Introduction to I2P";
    t[2501] = "\u0412\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0432 i2p";
    t[2502] = "Update available";
    t[2503] = "\u0414\u043e\u0441\u0442\u0443\u043f\u043d\u043e \u043e\u0431\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435";
