    t[2566] = "How long we've been running for this session";
    t[2567] = "\u0412\u0440\u0435\u043c\u044f \u0440\u0430\u0431\u043e\u0442\u044b \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0441 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0433\u043e \u0437\u0430\u043f\u0443\u0441\u043a\u0430";
    t[2568] = "Jars";
    t[2569] = "Jar-\u0444\u0430\u0439\u043b\u044b";
