    t[3394] = "banned until restart";
    t[3395] = "\u0437\u0430\u0431\u043b\u043e\u043a\u0438\u0440\u043e\u0432\u0430\u043d \u0434\u043e \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0430";
    t[3396] = "A fork of the <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent client</a> refactored for use on the I2P network. Usually supplied as part of the default suite of applications with Java I2P, and also available as a <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>standalone Java application</a>.";
    t[3397] = "\u0412\u0430\u0440\u0438\u0430\u043d\u0442 \u043a\u043b\u0438\u0435\u043d\u0442\u0430 BitTorrent <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark</a>, \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u0434\u043b\u044f \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0432 \u0441\u0435\u0442\u0438 I2P. \u041e\u0431\u044b\u0447\u043d\u043e \u043f\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0435 \u0441 Java I2P \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0447\u0430\u0441\u0442\u0438 \u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0442\u043d\u043e\u0433\u043e \u043d\u0430\u0431\u043e\u0440\u0430 \u043f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u0439 \u0438 \u0442\u0430\u043a\u0436\u0435 \u0434\u043e\u0441\u0442\u0443\u043f\u0435\u043d \u043a\u0430\u043a <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>\u043e\u0442\u0434\u0435\u043b\u044c\u043d\u043e\u0435 Java-\u043f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u0435</a>.";
    t[3400] = "Shutdown imminent";
    t[3401] = "\u041d\u0435\u043e\u0442\u043c\u0435\u043d\u044f\u0435\u043c\u043e\u0435 \u0432\u044b\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435";
    t[3402] = "UDP for SAM bridge";
    t[3403] = "UDP \u0434\u043b\u044f \u043c\u043e\u0441\u0442\u0430 SAM";
    t[3410] = "Hiding {0} older profile.";
    t[3411] = new java.lang.String[] { "\u0421\u043a\u0440\u044b\u0432\u0430\u0435\u043c {0} \u0441\u0442\u0430\u0440\u044b\u0445 \u043f\u0440\u043e\u0444\u0438\u043b\u0435\u0439.", "\u0421\u043a\u0440\u044b\u0432\u0430\u0435\u043c {0} \u0441\u0442\u0430\u0440\u044b\u0445 \u043f\u0440\u043e\u0444\u0438\u043b\u0435\u0439.", "\u0421\u043a\u0440\u044b\u0432\u0430\u0435\u043c {0} \u0441\u0442\u0430\u0440\u044b\u0445 \u043f\u0440\u043e\u0444\u0438\u043b\u0435\u0439." };
    t[3416] = "If you are running the Tor Browser, you may use its Tor instance by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9150</code>.";
    t[3417] = "\u0415\u0441\u043b\u0438 \u0432\u044b \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0435 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 Tor, \u0432\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0435\u0433\u043e \u044d\u043a\u0437\u0435\u043c\u043f\u043b\u044f\u0440 Tor, \u043d\u0430\u0441\u0442\u0440\u043e\u0438\u0432 I2P \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c: <i>\u0422\u0438\u043f \u043f\u0440\u043e\u043a\u0441\u0438:</i> <code>SOCKS 5</code> <i>\u0425\u043e\u0441\u0442:</i> <code>127.0.0.1</code> <i>\u041f\u043e\u0440\u0442:</i> <code>9150</code>.";
    t[3428] = "Use IPv6 only (disable IPv4)";
    t[3429] = "\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0442\u043e\u043b\u044c\u043a\u043e IPv6 (\u043e\u0442\u043a\u043b\u044e\u0447\u0438\u0442\u044c IPv4)";
    t[3432] = "If set to true, this option will place an icon in the system tray / notification area, with basic service control options. [Disabled by default]";
    t[3433] = "\u0415\u0441\u043b\u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0432 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435 true, \u044d\u0442\u0430 \u043e\u043f\u0446\u0438\u044f \u0440\u0430\u0437\u043c\u0435\u0441\u0442\u0438\u0442 \u0437\u043d\u0430\u0447\u043e\u043a \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u043d\u043e\u043c \u0442\u0440\u0435\u0435 / \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u0443\u0432\u0435\u0434\u043e\u043c\u043b\u0435\u043d\u0438\u0439 \u0441 \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u043c\u0438 \u043e\u043f\u0446\u0438\u044f\u043c\u0438 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0441\u043b\u0443\u0436\u0431\u043e\u0439. [\u041f\u043e \u0443\u043c\u043e\u043b\u0447\u0430\u043d\u0438\u044e \u043e\u0442\u043a\u043b\u044e\u0447\u0435\u043d\u043e]";
    t[3440] = "Windows";
    t[3441] = "Windows";
    t[3444] = "Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[3445] = "\u0418\u0437\u043c\u0435\u043d\u0438\u0442\u0435 \u044d\u0442\u0438 \u043d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438, \u0442\u043e\u043b\u044c\u043a\u043e \u0435\u0441\u043b\u0438 \u0443 \u0432\u0430\u0441 \u0437\u0430\u0431\u043b\u043e\u043a\u0438\u0440\u043e\u0432\u0430\u043d HTTPS \u0438 \u043d\u0435 \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u043f\u0440\u043e\u0432\u0435\u0441\u0442\u0438 \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u0443\u044e \u0437\u0430\u0433\u0440\u0443\u0437\u043a\u0443.";
