    t[3524] = "Service (Wrapper) log";
    t[3525] = "\u0416\u0443\u0440\u043d\u0430\u043b \u0441\u0435\u0440\u0432\u0438\u0441\u0430 (\u043e\u0431\u0435\u0440\u0442\u043a\u0430)";
    t[3528] = "Floodfill enabled";
    t[3529] = "\u0424\u0443\u043d\u043a\u0446\u0438\u044f floodfill \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u0430";
    t[3538] = "Changelog";
    t[3539] = "\u0418\u0441\u0442\u043e\u0440\u0438\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u0439";
    t[3542] = "Internal Error";
    t[3543] = "\u0412\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u044f\u044f \u043e\u0448\u0438\u0431\u043a\u0430";
    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "\u042d\u0442\u043e\u0442 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440 \u0432 \u043c\u0438\u043b\u043b\u0438\u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445 \u043f\u0435\u0440\u0435\u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0435\u0442 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u0435 \u0432\u0440\u0435\u043c\u0435\u043d\u0438 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u043a\u0438 \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u044f \u043f\u043e \u0443\u043c\u043e\u043b\u0447\u0430\u043d\u0438\u044e (\u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u043e\u0435 \u043a\u0430\u043a <i>\u0417\u0430\u0434\u0435\u0440\u0436\u043a\u0430 \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u044f</i> \u0432 \u0440\u0430\u0437\u0434\u0435\u043b\u0435 \u00ab\u041f\u0435\u0440\u0435\u0433\u0440\u0443\u0437\u043a\u0430\u00bb), \u043f\u0440\u0435\u0436\u0434\u0435 \u0447\u0435\u043c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0431\u0443\u0434\u0435\u0442 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d \u043a\u0430\u043a \u043f\u0435\u0440\u0435\u0433\u0440\u0443\u0436\u0435\u043d\u043d\u044b\u0439 \u0438 \u0437\u0430\u043f\u0440\u043e\u0441\u044b \u0442\u0440\u0430\u043d\u0437\u0438\u0442\u043d\u043e\u0433\u043e \u0442\u0443\u043d\u043d\u0435\u043b\u044f \u0431\u0443\u0434\u0443\u0442 \u043e\u0442\u043a\u043b\u043e\u043d\u0435\u043d\u044b. [\u041f\u043e \u0443\u043c\u043e\u043b\u0447\u0430\u043d\u0438\u044e \u2014 750 \u043c\u0441 \u0438\u043b\u0438 1500 \u043c\u0441, \u0435\u0441\u043b\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043f\u043e\u043c\u0435\u0447\u0435\u043d \u043a\u0430\u043a \u043c\u0435\u0434\u043b\u0435\u043d\u043d\u044b\u0439]";
    t[3550] = "No lifetime events";
    t[3551] = "\u041d\u0435\u0442 \u0441\u043e\u0431\u044b\u0442\u0438\u0439 \u0437\u0430 \u0432\u0440\u0435\u043c\u044f \u0440\u0430\u0431\u043e\u0442\u044b";
    t[3556] = "No stored analysis";
    t[3557] = "\u041d\u0435\u0442 \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u043d\u043e\u0433\u043e \u0430\u043d\u0430\u043b\u0438\u0437\u0430";
    t[3560] = "To update with unsigned I2P+ release builds: <code>http://skank.i2p/i2pupdate.zip</code> or for the latest unsigned development builds: <code>http://skank.i2p/dev/i2pupdate.zip</code>";
    t[3561] = "\u0414\u043b\u044f \u043e\u0431\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u043d\u0435\u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0445 \u0441\u0431\u043e\u0440\u043e\u043a \u0432\u044b\u043f\u0443\u0441\u043a\u0430 I2P: <code>http://skank.i2p/i2pupdate.zip</code> \u0438\u043b\u0438 \u0434\u043b\u044f \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0445 \u043d\u0435\u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0445 \u0441\u0431\u043e\u0440\u043e\u043a \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u043a\u0438: <code>http://skank.i2p/dev/i2pupdate</code>";
    t[3564] = "Invalid form submission, probably because you used the 'back' or 'reload' button on your browser. Please resubmit.";
    t[3565] = "\u041d\u0435\u0432\u0435\u0440\u043d\u044b\u0435 \u0434\u0430\u043d\u043d\u044b\u0435 \u0444\u043e\u0440\u043c\u044b, \u0441\u043a\u043e\u0440\u0435\u0435 \u0432\u0441\u0435\u0433\u043e \u044d\u0442\u043e \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u0438\u0437-\u0437\u0430 \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u0412\u044b \u043d\u0430\u0436\u0438\u043c\u0430\u043b\u0438 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u041d\u0430\u0437\u0430\u0434\" \u0438\u043b\u0438 \"\u041e\u0431\u043d\u043e\u0432\u0438\u0442\u044c\" \u0432 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0435. \u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u0437\u0430\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u043e\u0440\u043c\u0443 \u0437\u0430\u043d\u043e\u0432\u043e.";
    t[3566] = "Restart Status";
    t[3567] = "\u0421\u0442\u0430\u0442\u0443\u0441 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0430";
    t[3568] = "IPv6 Configuration";
    t[3569] = "\u041a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044f IPv6";
    t[3578] = "Peak throughput (bytes per second) over a 1 minute period that the peer has sustained in a single tunnel.";
    t[3579] = "\u041f\u0438\u043a\u043e\u0432\u0430\u044f \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0430\u044f \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u044c (\u0431\u0430\u0439\u0442 \u0432 \u0441\u0435\u043a\u0443\u043d\u0434\u0443) \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 1-\u043c\u0438\u043d\u0443\u0442\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0438\u043e\u0434\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u044b\u0439 \u0443\u0437\u0435\u043b \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u043b \u0432 \u043e\u0434\u043d\u043e\u043c \u0442\u0443\u043d\u043d\u0435\u043b\u0435.";
    t[3582] = "Known high capacity peers";
    t[3583] = "\u0418\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0435 \u043a\u043e\u043b\u043b\u0435\u0433\u0438 \u0441 \u0432\u044b\u0441\u043e\u043a\u043e\u0439 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c\u044e";
    t[3586] = "Proxy to connect to I2P's anonymized IRC chat network";
