    t[4982] = "They offered to introduce us (help peers traverse our firewall)";
    t[4983] = "\u041e\u043d\u0438 \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b\u0438 \u043d\u0430\u0441 \u043f\u043e\u0437\u043d\u0430\u043a\u043e\u043c\u0438\u0442\u044c (\u043f\u043e\u043c\u043e\u0447\u044c \u043a\u043e\u043b\u043b\u0435\u0433\u0430\u043c \u043f\u0440\u043e\u0439\u0442\u0438 \u0447\u0435\u0440\u0435\u0437 \u043d\u0430\u0448 \u0431\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u044d\u0440)";
