    t[5385] = "\u041f\u0435\u0440\u0435\u0434\u0430\u043d\u043e";
    t[5390] = "Unsigned update available";
    t[5391] = "Unsigned Update \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u043e";
    t[5406] = "Advanced Configuration";
    t[5407] = "\u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u043d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438";
    t[5408] = "Is the peer responding to tests in a timely fashion? To configure the timeout value: <code>router.peerTestTimeout={n}</code> (value is milliseconds, default 1000ms)";
    t[5409] = "\u0421\u0432\u043e\u0435\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u043b\u0438 \u043f\u0430\u0440\u0442\u043d\u0435\u0440 \u043e\u0442\u0432\u0435\u0447\u0430\u0435\u0442 \u043d\u0430 \u0442\u0435\u0441\u0442\u044b? \u0427\u0442\u043e\u0431\u044b \u043d\u0430\u0441\u0442\u0440\u043e\u0438\u0442\u044c \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435 \u0442\u0430\u0439\u043c\u0430\u0443\u0442\u0430: <code>router.peerTestTimeout={n}</code> (\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435 \u2014 \u043c\u0438\u043b\u043b\u0438\u0441\u0435\u043a\u0443\u043d\u0434\u044b, \u043f\u043e \u0443\u043c\u043e\u043b\u0447\u0430\u043d\u0438\u044e \u2014 1000 \u043c\u0441).";
    t[5412] = "Technology news &amp; reviews";
