    t[6221] = "\u0411\u043b\u0438\u0436\u0430\u0439\u0448\u0438\u0435 \u0437\u0430\u0442\u043e\u043f\u043b\u0435\u043d\u0438\u044f \u043a \u0437\u0430\u0432\u0442\u0440\u0430\u0448\u043d\u0435\u043c\u0443 \u043a\u043b\u044e\u0447\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0438\u0438 (\u0433\u0434\u0435 \u043c\u044b \u0431\u0443\u0434\u0435\u043c \u0445\u0440\u0430\u043d\u0438\u0442\u044c \u043d\u0430\u0448 RI)";
