    t[9076] = "UPnP reports the maximum downstream bit rate is {0}bits/sec";
    t[9077] = "UPnP \u0441\u043e\u043e\u0431\u0449\u0430\u0435\u0442 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0443\u044e \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u043d\u0438\u0441\u0445\u043e\u0434\u044f\u0449\u0435\u0433\u043e \u043f\u043e\u0442\u043e\u043a\u0430 {0}\u0431\u0438\u0442/\u0441\u0435\u043a\u0443\u043d\u0434\u0443";
