    t[9094] = "Also, <b>do not enter a private IP address</b> like 127.0.0.1 or 192.168.1.1.";
    t[9095] = "\u0422\u0430\u043a\u0436\u0435 <b>\u043d\u0435 \u0432\u0432\u043e\u0434\u0438\u0442\u0435 IP \u0438\u0437 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u044b\u0445 \u0434\u0438\u0430\u043f\u0430\u0437\u043e\u043d\u043e\u0432</b>, \u0442\u0430\u043a\u0438\u0435 \u043a\u0430\u043a 127.0.0.1 \u0438\u043b\u0438 192.168.1.1.";
