    t[9132] = "i2ptunnel";
    t[9133] = "\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0442\u0443\u043d\u043d\u0435\u043b\u0435\u0439 I2P";
    t[9134] = "config";
    t[9135] = "\u041d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438";
