    t[9163] = "I2P \u0412\u0438\u043a\u0438";
    t[9164] = "Connection is backlogged";
    t[9165] = "\u0421\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 \u0437\u0430\u0431\u043b\u043e\u043a\u0438\u0440\u043e\u0432\u0430\u043d\u043e";
