    t[9435] = "\u0416\u0443\u0440\u043d\u0430\u043b \u0441\u043e\u0431\u044b\u0442\u0438\u0439";
    t[9440] = "Error starting plugin {0}";
    t[9441] = "\u041e\u0448\u0438\u0431\u043a\u0430 \u0437\u0430\u043f\u0443\u0441\u043a\u0430 \u043c\u043e\u0434\u0443\u043b\u044f {0}";
    t[9446] = "Reseeding: fetching router info from seed URL ({0} successful, {1} errors).";
    t[9447] = "\u041f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0441\u044f \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u0430\u044f \u0437\u0430\u0433\u0440\u0443\u0437\u043a\u0430: \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0435 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438 \u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u0445 (\u0443\u0434\u0430\u0447\u043d\u043e: {0}, \u043e\u0448\u0438\u0431\u043e\u043a: {1}).";
    t[9452] = "UDP port";
    t[9453] = "UDP-\u043f\u043e\u0440\u0442";
    t[9454] = "What is an eepsite?";
    t[9455] = "\u0427\u0442\u043e \u0442\u0430\u043a\u043e\u0435 eepsite?";
