    t[10062] = "This setting determines the delay between peer test jobs, configured in milliseconds. [Default is 5000]";
    t[10063] = "\u042d\u0442\u043e\u0442 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0435\u0442 \u0437\u0430\u0434\u0435\u0440\u0436\u043a\u0443 \u043c\u0435\u0436\u0434\u0443 \u0437\u0430\u0434\u0430\u043d\u0438\u044f\u043c\u0438 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u043e\u0433\u043e \u0442\u0435\u0441\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f, \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u0443\u044e \u0432 \u043c\u0438\u043b\u043b\u0438\u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445. [\u041f\u043e \u0443\u043c\u043e\u043b\u0447\u0430\u043d\u0438\u044e \u2013 5000]";
    t[10072] = "A guide to reseeding the router";
    t[10073] = "\u0420\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e \u043f\u043e \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0439 \u0437\u0430\u0433\u0440\u0443\u0437\u043a\u0435 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "\u0421\u043f\u0438\u0441\u043e\u043a \u0441\u0442\u0440\u0430\u043d, \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u043d\u044b\u0439 \u0438\u0437 <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>\u0414\u043e\u043a\u043b\u0430\u0434\u0430 \u043e \u0441\u0432\u043e\u0431\u043e\u0434\u0435 \u0432 \u043c\u0438\u0440\u0435</a>, \u0441 \u043f\u043b\u043e\u0445\u043e\u0439 \u0440\u0435\u043f\u0443\u0442\u0430\u0446\u0438\u0435\u0439 \u0432 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0438\u0445 \u0441\u0432\u043e\u0431\u043e\u0434. \u042d\u0442\u043e\u0442 \u0441\u043f\u0438\u0441\u043e\u043a \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0438\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u043e\u0432, \u0440\u0430\u0431\u043e\u0442\u0430\u044e\u0449\u0438\u0445 \u0432 \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u044b\u0445 \u0441\u0442\u0440\u0430\u043d\u0430\u0445, \u0432 \u0440\u0435\u0436\u0438\u043c <i>\u0421\u043a\u0440\u044b\u0442\u044b\u0439</i> (Hidden Mode), \u0447\u0442\u043e\u0431\u044b \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0442\u044c \u0443\u043b\u0443\u0447\u0448\u0435\u043d\u043d\u0443\u044e \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u044c \u0434\u043b\u044f \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u0439. \u0412 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0441\u0442\u0440\u043e\u0433\u0438\u0445 \u0441\u0442\u0440\u0430\u043d \u0432\u044b\u0434\u0435\u043b\u0435\u043d\u044b \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435: \u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d, \u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d, \u0411\u0430\u0445\u0440\u0435\u0439\u043d, \u0411\u0435\u043b\u0430\u0440\u0443\u0441\u044c, \u0411\u0440\u0443\u043d\u0435\u0439, \u0411\u0443\u0440\u0443\u043d\u0434\u0438, \u041a\u0430\u043c\u0435\u0440\u0443\u043d, \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430, \u0427\u0430\u0434, \u041a\u0438\u0442\u0430\u0439, \u041a\u0443\u0431\u0430, \u0414\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u041a\u043e\u043d\u0433\u043e, \u0415\u0433\u0438\u043f\u0435\u0442, \u042d\u043a\u0432\u0430\u0442\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u0430\u044f \u0413\u0432\u0438\u043d\u0435\u044f, \u042d\u0440\u0438\u0442\u0440\u0435\u044f, \u042d\u0444\u0438\u043e\u043f\u0438\u044f, \u0418\u0440\u0430\u043d, \u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d, \u041b\u0430\u043e\u0441, \u041b\u0438\u0432\u0438\u044f, \u041c\u044c\u044f\u043d\u043c\u0430, \u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u041a\u043e\u0440\u0435\u044f, \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u043a\u0438\u0435 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438, \u0420\u0443\u0430\u043d\u0434\u0430, \u0421\u0430\u0443\u0434\u043e\u0432\u0441\u043a\u0430\u044f \u0410\u0440\u0430\u0432\u0438\u044f, \u0421\u043e\u043c\u0430\u043b\u0438, \u042e\u0436\u043d\u044b\u0439 \u0421\u0443\u0434\u0430\u043d, \u0421\u0443\u0434\u0430\u043d, \u042d\u0441\u0432\u0430\u0442\u0438\u043d\u0438 (\u0421\u0432\u0430\u0437\u0438\u043b\u0435\u043d\u0434), \u0421\u0438\u0440\u0438\u044f, \u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d, \u0422\u0430\u0438\u043b\u0430\u043d\u0434, \u0422\u0443\u0440\u0446\u0438\u044f, \u0422\u0443\u0440\u043a\u043c\u0435\u043d\u0438\u0441\u0442\u0430\u043d, \u0412\u0435\u043d\u0435\u0441\u0443\u044d\u043b\u0430, \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u043d\u044b\u0435 \u0410\u0440\u0430\u0431\u0441\u043a\u0438\u0435 \u042d\u043c\u0438\u0440\u0430\u0442\u044b, \u0423\u0437\u0431\u0435\u043a\u0438\u0441\u0442\u0430\u043d, \u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0421\u0430\u0445\u0430\u0440\u0430, \u0419\u0435\u043c\u0435\u043d.";
