    t[11376] = "Removed";
    t[11377] = "\u0423\u0434\u0430\u043b\u0435\u043d\u043e";
    t[11384] = "Click the <i>Start</i> button for your webserver tunnel on the <a href=/i2ptunnelmgr/>main Tunnel Manager page</a>. You should now see it listed under <i>Service Tunnels</i> on the <a href=/>Router Console</a> sidebar. A green star displayed next to the tunnel name (<i>I2P Webserver</i> by default) indicates that your website is active on the I2P network.";
    t[11385] = "\u041d\u0430\u0436\u043c\u0438\u0442\u0435 \u043a\u043d\u043e\u043f\u043a\u0443 <i>\u0417\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u044c</i> \u0434\u043b\u044f \u0432\u0430\u0448\u0435\u0433\u043e \u0442\u0443\u043d\u043d\u0435\u043b\u044f \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u043d\u0430 <a href=/i2ptunnelmgr/>\u043e\u0441\u043d\u043e\u0432\u043d\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0435 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u043d\u0435\u043b\u0435\u0439</a>. \u0422\u0435\u043f\u0435\u0440\u044c \u0432\u044b \u0434\u043e\u043b\u0436\u043d\u044b \u0443\u0432\u0438\u0434\u0435\u0442\u044c \u0435\u0433\u043e \u0432 \u0441\u043f\u0438\u0441\u043a\u0435 <i>\u0421\u043b\u0443\u0436\u0435\u0431\u043d\u044b\u0445 \u0442\u0443\u043d\u043d\u0435\u043b\u0435\u0439</i> \u0432 \u0431\u043e\u043a\u043e\u0432\u043e\u0439 \u043f\u0430\u043d\u0435\u043b\u0438 <a href=/>\u041a\u043e\u043d\u0441\u043e\u043b\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430</a>. \u0417\u0435\u043b\u0435\u043d\u0430\u044f \u0437\u0432\u0435\u0437\u0434\u0430 \u0440\u044f\u0434\u043e\u043c \u0441 \u0438\u043c\u0435\u043d\u0435\u043c \u0442\u0443\u043d\u043d\u0435\u043b\u044f (<i>I2P Webserver</i> \u043f\u043e \u0443\u043c\u043e\u043b\u0447\u0430\u043d\u0438\u044e) \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u043d\u0430 \u0442\u043e, \u0447\u0442\u043e \u0432\u0430\u0448 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442 \u0430\u043a\u0442\u0438\u0432\u0435\u043d \u0432 \u0441\u0435\u0442\u0438 I2P.";
