    t[12134] = "Select a section to add";
    t[12135] = "\u0412\u044b\u0431\u0435\u0440\u0438\u0442\u0435 \u0441\u0435\u043a\u0446\u0438\u044e \u0434\u043b\u044f \u0434\u043e\u0431\u0430\u0432\u043b\u0435\u043d\u0438\u044f";
    t[12142] = "The number of banned peers";
