    t[12404] = "The last router in a tunnel, which may be the <i>Outbound Endpoint</i>, where the client's tunnels meet the <i>Inbound Gateway</i> of the destination server's tunnels, or the <i>Inbound Endpoint</i> which is the final router in the chain that connects to the destination server.";
    t[12405] = "\u041f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0440\u043e\u0443\u0442\u0435\u0440 \u0432 \u0442\u0443\u043d\u043d\u0435\u043b\u0435, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c <i>\u041a\u043e\u043d\u0435\u0447\u043d\u043e\u0439 \u0422\u043e\u0447\u043a\u043e\u0439 \u0418\u0441\u0445\u043e\u0434\u044f\u0449\u0435\u0433\u043e \u0422\u0440\u0430\u0444\u0438\u043a\u0430</i>, \u0433\u0434\u0435 \u0442\u0443\u043d\u043d\u0435\u043b\u0438 \u043a\u043b\u0438\u0435\u043d\u0442\u0430 \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u044e\u0442\u0441\u044f \u0441 <i>\u0412\u0445\u043e\u0434\u044f\u0449\u0438\u043c \u0428\u043b\u044e\u0437\u043e\u043c</i> \u0442\u0443\u043d\u043d\u0435\u043b\u0435\u0439 \u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f, \u0438\u043b\u0438 <i>\u041a\u043e\u043d\u0435\u0447\u043d\u043e\u0439 \u0422\u043e\u0447\u043a\u043e\u0439 \u0412\u0445\u043e\u0434\u044f\u0449\u0435\u0433\u043e \u0422\u0440\u0430\u0444\u0438\u043a\u0430</i>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u043c \u0440\u043e\u0443\u0442\u0435\u0440\u043e\u043c \u0432 \u0446\u0435\u043f\u043e\u0447\u043a\u0435, \u0441\u043e\u0435\u0434\u0438\u043d\u044f\u044e\u0449\u0435\u0439 \u0441 \u0441\u0435\u0440\u0432\u0435\u0440\u043e\u043c \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f.";
